using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class WindGirderInputModel : Notifier	{		public WindGirderInputModel()		{					TankId = "";			TankHeight = "";			WindGirderRequired = "";			Qty = "";		}				private string _TankId;		public string TankId			{				get { return _TankId; }				set				{					_TankId = value;					OnPropertyChanged(nameof(TankId));				}			}				private string _TankHeight;		public string TankHeight			{				get { return _TankHeight; }				set				{					_TankHeight = value;					OnPropertyChanged(nameof(TankHeight));				}			}				private string _WindGirderRequired;		public string WindGirderRequired			{				get { return _WindGirderRequired; }				set				{					_WindGirderRequired = value;					OnPropertyChanged(nameof(WindGirderRequired));				}			}				private string _Qty;		public string Qty			{				get { return _Qty; }				set				{					_Qty = value;					OnPropertyChanged(nameof(Qty));				}			}			}}